    public function getSourceContext()
    {
        return new Source("{% extends 'layout.html.twig' %}
{% block title %}
    {{ 'Registracija - Prodaja autoprikolica, traktora.'|trans }} | prikolica.shop
{% endblock title %}
{% block metatags %}
    {{ parent() }}
    {#    <meta name=\"description\" content=\"{{ metaData.pageMetaDescription }}\"/>#}
    {#    <meta name=\"keywords\" content=\"{{ metaData.pageMetaKeywords }}\"/>#}
    <meta name=\"description\" content=\"Distribucija i prodaja autoprikolica i traktora.\">
    <meta name=\"keywords\" content=\"autoprikolice, prikolice, traktori, prodaja, cena, trigano, arilje\">
    <meta name=\"robots\" content=\"index, follow\">
    <link rel=\"canonical\" href=\"{{ app.request.uri }}\" />
{% endblock metatags %}

{% block content %}
    <!-- header  -->
    {% include 'include/header.html.twig' %}
    <!-- mobile fix menu -->
    {% include 'include/mobile_menu.html.twig' %}
    <!-- home slider -->
    <!-- Log In Section Start -->
    <div class=\"login-section\">
        <div class=\"materialContainer\">
            <div class=\"box\">
                <div class=\"login-title\">
                    <h2>Registrujte se</h2>
                </div>
                <br>
                {% if form_errors(form.nazivFirme) or form_errors(form.pib) or form_errors(form.email) or form_errors(form.password.first) or form_errors(form.password.second) %}
                    <div class=\"alert alert-danger\" role=\"alert\">
                        {{ form_errors(form.nazivFirme) }}
                        {{ form_errors(form.pib) }}
                        {{ form_errors(form.email) }}
                        {{ form_errors(form.password.first) }}
                        {{ form_errors(form.password.second) }}
                    </div>
                {% endif %}
                {{ form_start(form, {'attr': {'class' : 'needs-validation'}})}}
                <div class=\"input\">
                    {{ form_widget(form.pib) }}
                    <span class=\"spin\"></span>
                </div>
                <div class=\"input\">
                    {{ form_widget(form.nazivFirme) }}
                    <span class=\"spin\"></span>
                </div>
                <div class=\"input\">
                    {{ form_widget(form.email) }}
                    <span class=\"spin\"></span>
                </div>
                <div class=\"input\">
                    {{ form_widget(form.password.first) }}
                    <span class=\"spin\"></span>
                </div>
                <div class=\"input\">
                    {{ form_widget(form.password.second) }}
                    <span class=\"spin\"></span>
